const CompFooter = () => {
    const year = new Date().getFullYear(); // Obtener el año actual

    return (
        <footer class="footerStyle" style={{ textAlign: 'center', padding: '20px', background: 'linear-gradient(180deg, rgba(158, 171, 228, 0) 50%, #FFFFFF 100%)', color: 'black'}}>
            <p>© {year} RecipeApp. Todos los derechos reservados.</p>
        </footer>
    );
}

export default CompFooter;
